import React from 'react';
import  { useState} from 'react';


export default function Student() {

  const [file, setFile] = useState()
  console.log(file,"filedatatttttttttttttttt")

  function handleChange(event) {
    setFile(event.target.files[0])
  }


  const fileupload = async() => {
    console.log("fileuploadworking")

    try {
      let userData = await axios({
        method: "get",
        url: "http://localhost:8000/hell",
        data: {
       file
        },
        headers: {
          'Content-Type': 'application/json;odata=verbose',
          'Accept': 'application/json;odata=verbose',
          'X-RequestDigest': '0xAC7635D8AACC01B85B0BB943B709878B0569E0FFA72B4404ED169FC406919403AD36885D3854714A4087F98B505FC8EE174466A9F5ADE6588AA3651749C5850B',
          'Authorization': 'Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsIng1dCI6IjJaUXBKM1VwYmpBWVhZR2FYRUpsOGxWMFRPSSIsImtpZCI6IjJaUXBKM1VwYmpBWVhZR2FYRUpsOGxWMFRPSSJ9..cQ4Cga93F3VQiGMUwSl0bja2DoXNGW4JjcsJ5NyLyWP8TmTC15TPBSyI1gDioSQkOEpRN8ZRE71Fw2Y8J_hKPDqI_P9Q6OJsigYqBiWGOBDK0K6ADoshT4ZLdLmf-HdtDISY9n--Lla1wS2iagQewGOoiaueTlJV0fz1IflD-uxGJhZa2g1zmrDiY_0INJ7rnXDGosIVnqzSXDPCTJCHwOV9dv5FW1lWWhJggbDGkvxPN_Bn4EvB8bnYczQxpq8iE7EWlxcMAH_K73i4ZkQLZmdlaf2oMU7d5osmmNRY9b5yK-dlLmkilWtj_RpeCT-D-jqorcdr3XtojR0U-d4UOQ'
   },
      })


      console.log(userData,"userkadata")
  
  
    } catch (error) {
      console.log(error);
      toast.error('Wrong Credentials OR Roles are not Defined',
      {position: toast.POSITION.BOTTOM_RIGHT})  
      
    }
  
  
    
  
  
  }




  return (
    <div>
      <p>Dashboard</p>
      
          <h1>React File Upload</h1>
          <input type="file"
           onChange={handleChange}
            />
          <button onClick={fileupload} type="submit">Upload</button>
        
    </div>
    );
}
